import React from 'react'
import './NavBar.css'
import { Link } from "react-router-dom";


export const NavBar = () => {
  return (
    <div className='nav'>
        <div className='left-nav'>
            <li><Link to='/'></Link></li>
        </div>
        <div className='right-nav'>
            Test
        </div>
    </div>
 
)
}
